def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i, ratio in enumerate(ratios):
        if ratio < 0.2:
            priorities[i] = 1 / (1 + np.exp(-40 * (ratio - 0.2))) + 0.2
        elif ratio >= 0.2 and ratio < 0.6:
            priorities[i] = 1 / (1 + np.exp(-20 * (ratio - 0.4))) + 0.4
        elif ratio >= 0.6 and ratio < 0.8:
            priorities[i] = 1 / (1 + np.exp(-15 * (ratio - 0.7))) + 0.5
        else:
            priorities[i] = 1 / (1 + np.exp(-10 * (ratio - 1))) + 0.6

        if i % 6 == 0:
            priorities[i] += 0.4
        else:
            for j in range(8):
                if i % (j + 3) == 0:
                    priorities[i] -= 0.06 * j
                elif i % (j + 4) == 0:
                    priorities[i] += 0.08 * j
                else:
                    priorities[i] += 0.04 * j

        if i % 3 == 0:
            priorities[i] *= 1.6
        else:
            priorities[i] += 0.7

    return priorities
